import React,{useState,useEffect} from"react"
import axios from "axios";
import { useParams } from 'react-router-dom';
import { Link } from "react-router-dom";

export default function VehiDe(){

    const{id}=useParams();

    const [vehicle, setVehicles] = useState([]);

    const getVehicle = () => {
        axios.get('http://localhost:6060/Vehicle/get/'+id)
        .then((res) => {
            console.log(res.data);
            setVehicles(res.data.Vehicle);
            
        })
        .catch((err) => {
            alert(err.message);
        });    
        
    };

    useEffect(() => {
        getVehicle();
        
    }, []);


    return(
<div>
<div className="col-md-6" style={{textAlign:"center", display: "flex", marginBottom: "2px", width:"100%"}} >
      <div className="gallery_box" style={{display: "flex", justifyContent: "center"}}>
        <div className="gallery_img" style={{marginRight: "20px"}}>
        <p className="looking_text" style={{fontSize:"40px",fontStyle:"italic",fontStretch:"expanded"}} >{vehicle.regnumber}</p>
        </div>
      </div>
    </div>
    <div className="col-md-6" style={{ display: "flex", marginBottom: "2px", width:"100%"}}>
      <div className="gallery_box" style={{display: "flex", justifyContent: "center"}}>
      <div className="details_container"style={{marginLeft:"-30%"}} >
      <div className="col-md-6" style={{width:"240px"}} >
      <div className="gallery_box" >
          {/* Additional details */}
          <ul className="vehicle_details" >
          <li className="types_text" style={{fontSize:"25px",marginTop:"15px"}} >{vehicle.model}</li>
            <li className="sp" style={{marginTop:"15px"}}><strong>Brand:</strong> {vehicle.brand}</li>
            <li className="sp" style={{marginTop:"15px"}}><strong>Year:</strong> {vehicle.year}</li>
            <li className="sp" style={{marginTop:"15px"}}><strong>Type:</strong> {vehicle.type}</li>
            <li className="sp" style={{marginTop:"15px"}}><strong>Fuel Type:</strong> {vehicle.fueltype}</li>
            <li className="sp" style={{marginTop:"15px"}}><strong>Available:</strong> {vehicle.available}</li>
            <li className="sp" style={{marginTop:"15px"}}><strong>Reg Number:</strong> {vehicle.regnumber}</li>
            <li className="looking_text" style={{marginTop:"15px"}} >Per day Rs: {vehicle.priceperday}.00</li>
            {/* Include other details similarly */}
          </ul>
          </div>
         </div>
        </div>
        <div className="gallery_img" style={{marginLeft:"3%"}}>
          <img src={`http://localhost:6060/images/${vehicle.image}`} alt="Vehicle" />
        </div>
        
      </div>
    </div>

    <div className="col-md-6" style={{display: "flex", marginBottom: "2px"}}>
      <div className="gallery_box" style={{display: "flex"}}>
        
      </div>
    </div>
</div>
    )
}
